// src/utils/api.js
const API_BASE_URL = 'http://localhost:5000';

export const fetchQuestions = async () => {
  const response = await fetch(`${API_BASE_URL}/questions`);
  return response.json();
};

export const submitAnswers = async (formSubmissionId, answers) => {
  const response = await fetch(`${API_BASE_URL}/submit-answers`, {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify({ formSubmissionId, answers }),
  });
  return response.json();
};

export const fetchDiagnosisResults = async (formSubmissionId) => {
  const response = await fetch(`${API_BASE_URL}/diagnosis-results?formSubmissionId=${formSubmissionId}`);
  return response.json();
};
